import { useParams, Route } from "react-router-dom";
import { Fragment } from "react";
import QuoteItem from "../components/quotes/QuoteItem";

const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quote</h1>
      <p>{params.quoteId}</p>
    </Fragment>
  );
};

export default QuoteDetail;
